let mcqData = [
  {
    id: 1,
    que: "What is HTML",
    ans: "Hyper Text MarkUp Language",
  },
  {
    id: 2,
    que: "What is HTML",
    ans: "Cascading Style Sheet",
  },
  {
    id: 3,
    que: "What is Js",
    ans: "Java Script",
